import time


#f = open("input.txt",'r') #input from a large file, 4.2MB
#genome =  f.read()
genome =''
L = 566 # genome substring length
k = 11 # length of the motif
t = 18 # minimum repetition of the motif

# expected output = AAACCAGGTGG

motif_len = k # for better readability
list = []
n = 0
start_time = time.time()
while n <= len(genome) - L:
	s = genome[n:n+L]
	n += 1
	motif_dict = {}
	for i in range(len(s)-motif_len):
		motif = s[i:i+motif_len]
		if motif not in motif_dict:
			motif_dict[motif] = 1
		else:
			motif_dict[motif] += 1
	for k in motif_dict:
		if motif_dict[k] >= t and k not in list:
			list.append(k)


y = 0
while y < len(list):
	print(list[y]),
	y += 1
    
    
#f.close()
print('\nexecution time :' + str(time.time() - start_time) + ' seconds')